import './styles.css';

export const Retailer = () => {
    return(
        <div>
            <h1>Retailer</h1>
            <form action="http://127.0.0.1:5000/api/getSushi" method="POST">      
                <input name="id" type="text" className="feedback-input" placeholder="Enter  ID"  />   
                <input type="submit" value="GET"/>
            </form>    
            <Link to='/'>Home</Link>
        </div>
    )
}
